  false,\n\t\"url\": null,\n\t\"notes\": \"Tetlin is located 13 miles south of Tetlin
  Junction and the Alaska Highway. The village is only accessible by overland vehicle
  when the ground is frozen via the Winter Trail which is approximately 20 miles long
  and is mostly single lane in width. The scope of work for this initial study involves
  evaluating the various road location alternatives between the Alaska Highway and
  Tetlin. It will also identify the environmental effects that are likely to occur
  if the proposed road is constructed. This work includes collecting and analyzing
  existing information, developing additional information as required, identifying
  impacts, determining design standards and criteria, laying out routes, estimating
  preliminary construction and maintenance costs, and recommending a route.\",\n\t\"owner_org\":
